import React from 'react';
import { Bar, Line, Pie } from 'react-chartjs-2';
import coqSummitData from '../data/coqSummitData.json';

getSnowPackData
const data = coqSummitData;
export const Chart = () => {
  return (
    <div className="chart">
      <Line
        data={data}
        options={{
          title: {
            display: true,
            text: "Snow Depth for the Coquihalla Area"
          },
          legend: {
            display: true,
            position: 'right'
          }
        }} />
    </div>
  );
};
